(12, 'Trêu Nhầm Yêu Thật ( Dĩ Ái Vi Doanh )', 'Trêu Nhầm Yêu Thật ( Dĩ Ái Vi Doanh ) là bộ phim truyền hình thuộc thể loại tình cảm đô thị của Trung Quốc, dựa trên tiểu thuyết Thác Liêu của tác giả Kiều Dao. Được dạo diễn bởi Quách Hổ (đạo diễn phim Trầm vụn hương phai) và kịch bản được viết bởi Dương Thiên Tử. Bộ phim có sự tham gia của các diễn viên chính là Bạch Lộc (đóng phim trường nguyệt tẫn minh) và Vương Hạc Đệ (đóng phim thương lan Quyết) . Kể về cuộc hành trình của chuyên viên báo chí tài năng Trịnh Thư Ý (do Bạch Lộc đóng) trong ngành báo chí tài chính. Cô đã nỗ lực để có cuộc phỏng vấn độc quyền với chủ tịch của tập đoàn Minh Dự Vân Sáng là Thời Yến (do Vương Hạc Đệ đóng). Hai người gặp nhau trong cuộc phỏng vấn này và để lại ấn tượng sâu sắc cho nhau. Trịnh Thư Ý viết nhiều bài báo khách quan và sắc bén sau khi nghiên cứu sâu về nhiều lĩnh vực, trong khi Thời Yến không ngừng tìm kiếm các doanh nghiệp mới nổi có tiềm năng và có trách nhiệm để đầu tư, mong muốn nỗ lực hết mình để cống hiến cho xã hội. Thời Yến nhận ra rằng quan điểm được truyền đạt qua các bài báo của Trịnh Thư Ý rất hợp với quan điểm của anh. Do đó, anh đã đồng ý tham gia cùng cô vào các bài báo về Minh Dự Vân Sáng. Trịnh Thư Ý và Thời Yến cùng nhau phân tích ngành, trao đổi quan điểm và thông qua các phương tiện truyền thông mới, họ mang đến cho độc giả thông tin tài chính mới nhất. Họ cũng đối mặt với nhiều khó khăn và thách thức trong quá trình đầu tư và phỏng vấn. Hai trái tim dần dần gần nhau hơn trong quá trình này. Cuối cùng, Trịnh Thư Ý thực hiện được ước mơ nghề nghiệp của mình với việc tạo ra một trang điện tử, còn Thời Yến cùng tập đoàn Minh Dự Vân Sáng đã hoàn thành nhiều dự án đầu tư thành công. Hai người cùng nhau mở ra một tương lai mới cho sự nghiệp và cuối cùng họ cũng tìm thấy tình yêu trong quá trình này.', 1, 'treu-nham-yeu-that-di-ai-vi-doanh6555.jpg', 5, 14, 5, 'Only For Love (2023)', 'treu-nham-yeu-that-di-ai-vi-doanh', 'u Nhầm Yêu Thật, Only For Love, Dĩ Ái Vi Doa